const renderHomework = (data) => {
    return `<div class="loader">
    <div class="song">
        <p class="name">${data.homework}</p>
        <div class="artist">
            <span>${data.remaining}</span>
        </div>
    </div>
    <div class="albumcover">
        ${data.svg}
    </div>
    <div class="course">
        ${data.subject}
    </div>
    <div class="late">
        ${data.late}
    </div>
</div>`
}
const renderAttendance = (data) => {
    return `<div class="loader">
    <div class="song">
        <p class="name" ${data.status.startsWith('缺') && 'style="color: crimson"'}>${data.status}</p>
        <div class="artist" ${data.status.startsWith('缺') && 'style="color: black"'}>
            <span>${'' + (data.start)?.replaceAll('/', '-')}</span>
        </div>
    </div>
    <div class="albumcover">
        ${data.svg}
    </div>
    <div class="course">
        ${data.subject}
    </div>
      <div class="late">
        ${'' + (data.end)?.replaceAll('/', '-')}
    </div>
</div>`
}
const renderSignUpList = (data) => {
    return `<div class="loader">
    <div class="song">
        <p class="name" >${data.msg}</p>
        <div class="artist">
            <span>${'操作时间: ' + (data.time)?.replaceAll('/', '-')}</span>
        </div>
    </div>
    <div class="albumcover">
        ${data.svg}
    </div>
    <div class="course">

    </div>
      <div class="late" style="top: 30px;font-size: 0.8em; color: mediumorchid;">${data.name}</div>
    </div>
</div>`
}

const homework = (data) => {
    data = Array.isArray(data) ? data : []

    const html = data.map((e) => {
        e.svg = array[Math.floor(Math.random() * array.length)]
        e.remaining = format(new Date(e.remaining), 'zh_CN')
        e.late = e.late ? "允许逾期提交" : "不允许逾期提交"
        return renderHomework(e)
    });
    if (html.length === 0) {
        html.push(renderHomework({
            "svg": array[Math.floor(Math.random() * array.length)],
            "subject": "",
            "homework": "暂无未完成作业",
            "remaining": "",
            "late": ""
        }))
    }

    return html.reduce((a, b) => a + b)
}

const attendance = (data) => {
    data = Array.isArray(data) ? data : []
    const html = data.map((e) => {
        e.svg = array[Math.floor(Math.random() * array.length)]
        e.end = e.end || "ㅤㅤㅤㅤㅤㅤ"
        return renderAttendance(e)
    });
    if (html.length === 0) {
        html.push(renderAttendance({
            "svg": array[Math.floor(Math.random() * array.length)],
            "subject": "",
            "status": "暂无签到记录",
            // 特殊字符占位
            "start": "ㅤㅤㅤㅤㅤㅤ",
            "end": "ㅤㅤㅤㅤㅤㅤ"
        }))
    }
    return html.reduce((a, b) => a + b)
}

const signup = (data) => {
    data = Array.isArray(data) ? data : []
    const html = data.sort((a, b) => (a.status ^ b.status) ? (a.status ? -1 : 1) : 0)
        .map((e) => {
            e.svg = array[array.length - 1 - (e.status ? 1 : 0)]
            return renderSignUpList(e)
        });
    if (html.length === 0) {
        html.push(renderSignUpList({
            // "svg": array[array.length-1],
            "svg": array[Math.max(Math.floor(Math.random() * array.length - 2), 0)],
            "name": "",
            "msg": '签到人数为 0',
            "time": `${dayjs(new Date()).format('YYYY-MM-DD HH:mm:ss')}`
        }))
    }
    return [html.reduce((a, b) => a + b), '签到清单']
}
export {
    homework, attendance, signup
}
